import { graph } from "./graph.png";
import React from 'react';

const BackgroundImage = () => {
  return (
    <div>
       <img src={graph} className="graph_image" alt="graph" />
       <h2>Choose a date range</h2>
       <h3>Lorem ipsum dolor sit amet,consectetur adipiscing elit. Mauris imperdiet bibendum</h3>
    </div>
  )
}

export default BackgroundImage;
